import React from "react";
import "./style.css";
import Menu_AdminPage from "./../../../components/menu_adminpage";
function Revenue() {
  return (
    <div>
      <div style={{ backgroundColor: "#efefef" }}>
        <div style={{ height: "100px" }}>
          <Menu_AdminPage />
        </div>
      </div>
    </div>
  );
}

export default Revenue;
